// Used by Android VHAL, QNX APP-Clusters and other QNX service.
// QNX APP-Clusters and other QNX service must use this message to communication with QNX VehicleServcie
message VehiclePropValue {
	// common data
	required int32  prop                = 1;  // Property identifier. Android VHAL, QNX APP-Clusters and other QNX service require to set it
	optional int32  value_type          = 2;  // value type
	optional int64  timestamp           = 3;
	optional VehiclePropStatus  status  = 10;

	// values
	optional int32  area_id             = 4;
	repeated sint32 int32_values        = 5;  // If the property is INT32 or BOOL or INT32_VEC, Android VHAL, QNX APP-Clusters and other QNX service need to set it
	repeated sint64 int64_values        = 6;  // If the property is INT64 or INT64_VEC, Android VHAL, QNX APP-Clusters and other QNX service need to set it
	repeated float  float_values        = 7;  // If the property is FLOAT or FLOAT_VEC, Android VHAL, QNX APP-Clusters and other QNX service need to set it
	optional string string_value        = 8;  // If the property is STRING, Android VHAL, QNX APP-Clusters and other QNX service need to set it
	optional bytes  bytes_value         = 9;  // If the property is BYTES, Android VHAL, QNX APP-Clusters and other QNX service need to set it
};
//Used by send or receive signal group message, the prefix ig is the SIG ID of the Signal Group
//if subscribe sig group, vehicle service will send VehicleSigGroupValue msg, is contain a VehiclePropValue message array
message VehicleSigGroupValue {
	repeated VehiclePropValue sig_group = 1;
};
